トヨタ FJクルーザーのフロントフェイスを引締まった印象にします。 純正とは一味違うブラックインナー。ヘッドランプの周りにはLEDホワイトライトバーを配置しました。専用設計なので取付は純正品と交換するだけで簡単です。配線は一部加工が必要になります。<br><br>●バルブ(別売)：ハイ/ローH7(切替式)  (サービスバルブ付属)●左側通行用(日本光軸仕様) ●左右セット 【注意】球切れ警告灯対策用ダミーロードが必要な場合がございます。<br><br>【LEDの球切れ、水漏れ（レンズ接合部からの水滴の浸入）に対してご購入されてから1年間完全保証いたします。※保証が適用されるのは製品本体に保証番号の付いたSONAR正規品のみとなりますのでご了承下さい。】<br><br><br>対応車種：トヨタ FJクルーザー GSJ15W　北米仕様<br><br>ランプ、レンズ | ヘッドランプ<br>トヨタ | ＦＪクルーザー | GSJ15W <br>※メーカー在庫切れの場合は納期を別途ご案内いたします。<tr><td colspan="2">
