エンジェルアイ（リング付）ヘッドライト。リング部はLEDバルブを使用しています。専用設計なので取付は純正品と交換するだけで簡単です。バルブやカプラーはそのままご使用いただけます。（一部簡単な加工を必要とする場合もあります。）<br><br>●ハロゲンヘッドライト用 ●LEDリング装備（ロー） ●左側通行用（日本光軸仕様） ●左右セット ※ES1/2/3 H12年9月～H15年8月 シビックフェリオ 前期用<br><br>【LEDの球切れ、水漏れ（レンズ接合部からの水滴の浸入）に対してご購入されてから1年間完全保証いたします。※保証が適用されるのは製品本体に保証番号の付いたSONAR正規品のみとなりますのでご了承下さい。】<br><br><br>対応車種：ES シビックフェリオ 4ドア 前期 00/9-03/8<br><br>ランプ、レンズ | ヘッドランプ<br>ホンダ | シビック | ES/EU/EP系 <br>※メーカー在庫切れの場合は納期を別途ご案内いたします。<tr><td colspan="2">
